import React from 'react';
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';

class MapView extends React.Component {
  static defaultProps = {
    center: {
      lat: 40.73,
      lng: -73.93
    },
    zoom: 14
  }
  componentDidMount(){
    this.setState({center:this.props.currentLocation});
  }
  render(){
    let parkingSpots= this.props.parkingSpots.map(spot=> <Marker position={{lat:spot.lat, lng:spot.lng}}/>)
    return(
      <div style={{ height: '100vh', width: '100%' }}>
        <Map
        google={this.props.google}
          initialCenter={this.state.center}
          zoom={this.props.zoom}>
          <Marker position ={{lat:59.955413, lng:30.337844}}/>
            {parkingSpots}
        </Map>
      </div>
    )
  }
}

export default GoogleApiWrapper({apiKey: "AIzaSyDS7fqSLY5L2xuXAb8cIb1vyQRKt5EPXmw"}) (MapView)
